import React from 'react';
import { Redirect, Route, Switch } from 'react-router-dom';

import { Routes } from '../common/App/App';
import { PermissionsBrowser } from './PermissionsBrowser';

export default function PermissionsDashboard() {
  return (
    <Switch>
      <Route path={Routes.Permissions} component={PermissionsBrowser} />
      <Redirect to={Routes.Restaurants} />
    </Switch>
  );
}

